import React, { Component } from "react";
import { Row, Col, Container } from "react-bootstrap";
import Config from '../scripts/config';
import YAML from 'yaml';

class Konumlar extends Component {
  state = {
    konumlar: [],
  };

  componentDidMount() {
    this.loadKonumlar();
  }

  loadKonumlar() {
    fetch('konumlar.yaml')
      .then((response) => response.text())
      .then((data) => {
        const konumlar = YAML.parse(data);
        this.setState({ konumlar });
      })
      .catch((error) => {
        console.error('Dosya okunurken bir hata oluştu:', error);
      });
  }

  render() {
    const { konumlar } = this.state;

    return (
      <div>
        <h3>Konumlar:</h3>
        {Object.keys(konumlar).map((key) => (
          <div key={key}>
            <strong>{key}:</strong> ({konumlar[key].x}, {konumlar[key].y}, {konumlar[key].z})
          </div>
        ))}
      </div>
    );
  }
}

export default Attractions
